import React, {Component} from "react";
import {Card, CardImg, CardBody, CardTitle, 
    CardSubtitle, CardDeck} from 'reactstrap';
import BarGraph from './bar_chart.jpg'


export class Visualizations extends Component {

    render(){
        
        return(
        	<div>
            <h4>Visualizations</h4>
            <CardDeck>
            	<Card>
            		<CardImg top width="25%" height="25%" src={BarGraph}  alt={"No image"} />
            	</Card>
            </CardDeck>
            </div>
        );
    }
    
}

export default Visualizations;
